function replace_text(lang, text)
{
    x = document.getElementById(text); //Find the element with id="demo"
    if (x) { //if element exisits
        x.innerHTML = translation[lang][text];   //Change the HTML content
    }    
}
function translation_available(lang)
{    
    if (translation[lang]) {
        return lang;
    } else {
        return "source";
    }
}
function detect_language()
{
    var detected_language = navigator.language;
	if (detected_language == "zh-CN") {detected_language = "zh-Hans";
		} else if (detected_language == "zh-SG") {detected_language = "zh-Hans";
		} else if (detected_language == "zh-MY" ) {detected_language = "zh-Hans";
		} else if (detected_language == "zh-CHS" ) {detected_language = "zh-Hans";
		} else if (detected_language == "zh-HK") {detected_language = "zh-Hant";
		} else if (detected_language == "zh-MO" ) {detected_language = "zh-Hant";
		} else if (detected_language == "zh-TW" ) {detected_language = "zh-Hant";
		} else if (detected_language == "zh-CHT" ) {detected_language = "zh-Hant";
		} else if (detected_language.length > 2) {detected_language = detected_language[0] + detected_language[1];};   
    return translation_available(detected_language);
}
function translate()
{
    var detected_language = detect_language();
    for (x in translation["source"]) {
        replace_text(detected_language, x);
    }
}